import React from 'react'
import ReactDom from 'react-dom';
const MainLayout = () => {
    return (
        
        
        <div className="main-layout">
           
        <div class="row">
        <div class="col-sm-6">
        <img src={require('../icons/dev gold.png')} className="icon1" />
        </div>
        <div class="col-sm-6">
        <img src={require('../icons/.png')} className="icons"/>
        </div>
        
        </div>
        
        
        
        </div>
        
        
    );
}

export default MainLayout;
